import './css/App.css'
import './css/colors.css'
import Navbar from './navbar'

import axios from 'axios'

function App() {
    axios.get(localStorage.getItem('url') + '/about.json')
    .then(function (res) {
        console.log(res);

        const temp = document.getElementById('content')
        temp.innerHTML = res.data
    })
    .catch(function (err) {
        console.log(err)
    });

    return (
        <div className="App">
            <Navbar />
            <div id="content"></div>
        </div>
    );
}

export default App;
